var m = {};


window.onload = function(){
	var projectModalButton = Vue.extend({
		template:'<button type="button" class="btn btn-primary btn-lg" v-on:click="setProvider()" data-toggle="modal" data-target="#projectModal">'
				+'Start a Project!'
				+'</button>',
		methods:{
			setProvider:function(){
				var name = jQuery('#create-a-makeros-project').attr('provider-name');
				m.$set('provider', name);
				jQuery('#providername').html(name).css('textTransform', 'capitalize');
			},
		},
	});

	var accountForm = Vue.extend({
		template:'<div class="form-group hidden" id="accountform">'
					+'<label class="show-create-account hidden col-sm-12">'
						+'Your Name'
					+'</label>'
					+'<div class="show-create-account hidden col-sm-12">'
						+'<input class="form-control name" name="name">'
					+'</div>'
					+'<label class="col-sm-12">'
						+'Email'
					+'</label>'
					+'<div class="col-sm-12">'
						+'<input class="form-control email" name="email">'
					+'</div>'
					+'<label class="col-sm-12">'
						+'Password'
					+'</label>'
					+'<div class="col-sm-12">'
						+'<input type="password" class="form-control password" name="password">'
						+'<span id="loginfail" style="color:red;font-weight:bold" class="hidden">Incorrect email address or password.</span>'
					+'</div>'
					+'<label class="col-sm-12 show-create-account hidden">'
						+'Confirm Password'
					+'</label>'
					+'<div class="show-create-account hidden col-sm-12">'
						+'<input type="password" class="show-create-account hidden form-control" name="confirm_password">'
					+'</div>'
					+'<div class="show-create-account col-sm-12">'
						+'<center>'
							+"Don't have an account?"
							+"<a class='btn' v-on:click='changetype()'>Click Here to enter a username and create one.</a>"
						+'</center>'
					+'</div>'
					+'<div class="show-create-account hidden col-sm-12">'
						+"<a class='btn' style='padding-left:30%;' v-on:click='changetype()'>Go Back</a>"
					+'</div>'

					+'<div class="row"></div>'
				+'</div>',
		methods:{
			login:function(){
				jQuery('.stepbutton').addClass('hidden');
				jQuery('.login-step').removeClass('hidden');
			},
			changetype:function(){
				jQuery('.show-create-account').toggleClass('hidden');
				jQuery('.show-login-account').toggleClass('hidden');
				jQuery('.show-create-button').toggleClass('hidden');
			},
		},
	});

	var widgetForm = Vue.extend({
		components:{
			'account-form':accountForm,
		},
		template:'<account-form></account-form>'
				+'<div class="form-group" id="projectform">'
					+'<label class="col-sm-2">'
						+'Title'
					+'</label>'
			    	+'<div class="col-sm-10">'
						+'<input name="title" v-on:keyup="validateNext()" class="form-control title">'
						+'<span class="help-block">Give your project a name.</span>'
			    	+'</div>'
					+'<label class=col-sm-2>'
						+'Files'
			    	+'</label>'
			    	+'<div class="col-sm-10">&nbsp'
			    		+"<input type='hidden' class='form-control' role='uploadcare-uploader'  data-multiple='data-multiple' data-clearable='data-clearable' name='uploadcare_group'>"
			    	+'</div>'
					+'<div class="col-sm-12">&nbsp</div>'
					+'<label class="col-sm-2">'
						+'Description'
					+'</label>'
			    	+'<div class="col-sm-10">'
						+'<textarea class="form-control desc" v-on:keyup="validateNext()" style="height:150px;" name="desc"></textarea>'
						+"<span class='help-block'>In as many words as you'd like, please describe what you'd like to make.</span>"
					+'</div>'
					+'<span class="col-sm-2"></span>'
					+'<span class="col-sm-10">'
						+"<i v-on:click='readAgreement(), validateNext()' id='service' value='0' class='fa fa-square-o'></i> I have read and accept the <a target='_blank' id='serviceagreement'>Services Agreement</a>"
					+'</span>'
					+'<div class="row"></div>'
				+'</div>',
		methods: {
			readAgreement: function(){
				var agreement = jQuery('#service');
				agreement.toggleClass('fa-check-square-o').toggleClass('fa-square-o');
				if(agreement.attr('value') == 1){
					m.$set('form.agreement', 0)
					agreement.attr('value', 0); 
				}else{
					m.$set('form.agreement', 1)
					agreement.attr('value', 1); 
				}
			},
			validateNext:function(){
				var title = jQuery('.title').val();
				var desc = jQuery('.desc').val();
				var agreement =  jQuery('#service').attr('value');

				console.log('tit', title);
				console.log('desc', desc);
				console.log('ag', agreement);

				if(title > '' && desc > '' && agreement > 0){
					jQuery('.account-step').removeClass('btn-warning').addClass('btn-primary').removeAttr('disabled');
				}
				
			},
		},
		ready: function(){
			jQuery('#serviceagreement').attr('href', 'http://'+jQuery('#create-a-makeros-project').attr('provider-name')+'.makeros.dev/agreement');
		},
	});

	var projectModalHead = Vue.extend({
		components:{
			'widget-form':widgetForm,
		},
		template:'<div class="modal fade" id="projectModal" tabindex="-1" role="dialog" aria-labelledby="projectModalLabel">'
					+'<div class="modal-dialog" role="document">'
						+'<div class="modal-content">'
							+'<div class="modal-header">'
								+'<button type="button" class="close" data-dismiss="modal" aria-label="Close">'
									+'<span aria-hidden="true">&times;</span>'
								+'</button>'
								+'<h4 class="modal-title" id="projectModalLabel">Start a New Project with <span id="providername"></span></h4>'
							+'</div>'
							+'<div class="modal-body">'
								+'<div class="row">'
								+'<widget-form></widget-form>'
							+'</div>'
							+'<div class="modal-footer" style="border:0px;">'
							+'<button type="button" class="stepbutton account-step next-step btn btn-warning" disabled v-on:click="accountStep()">'
								+'Next <i class="fa fa-arrow-right"></i>'
							+'</button>'
							+'<button type="button" class="stepbutton login-step hidden next-step btn btn-warning" v-on:click="projectstep()">'
								+'<i class="fa fa-arrow-left"></i> Back'
							+'</button>'
							+'<button type="button" class="login-step show-login-account hidden btn btn-success" v-on:click="login()">'
								+'Log In and Create Project <i class="fa fa-rocket"></i>'
							+'</button>'
							+'<button type="button" class="show-create-button hidden btn btn-success" v-on:click="login()">'
								+'Go to my new Project <i class="fa fa-rocket"></i>'
							+'</button>'
							+'<button type="button" class="stepbutton hidden start-project" v-on:click="startProject()" class="btn btn-success">'
								
							+'</button>'
						+'</div>'
					+'</div>'
				+'</div></div>',
		methods:{
			login:function(){
				var data = {};
				var form = {};

				jQuery('#projectform .form-control').each(function(){
					var name = jQuery(this).attr('name');
					data[name] = jQuery(this).val();
				});

				data.name = jQuery('#accountform .name').val();
				data.email = jQuery('#accountform .email').val();
				data.password = jQuery('#accountform .password').val();
				data.password_confirmation = jQuery('#accountform .password_confirmation').val();
				jQuery.post('http://'+jQuery('#create-a-makeros-project').attr('provider-name')+'.makeros.dev/widget/login', data, function(response){
					if(response.success === 1){
						window.location.href = response.url;
					}else{
						jQuery('#loginfail').removeClass('hidden');
					}
				});
			},
			accountStep:function(){
					jQuery('#projectform').addClass('hidden');
					jQuery('#accountform').removeClass('hidden');
					jQuery('.stepbutton').addClass('hidden');
					jQuery('.login-step').removeClass('hidden');
			},
			projectstep:function(){
				jQuery('#projectform').removeClass('hidden');
				jQuery('#accountform').addClass('hidden');
				jQuery('.stepbutton').addClass('hidden');
				jQuery('.login-step').addClass('hidden');
				jQuery('.account-step').removeClass('hidden');
			},
			startProject:function(){
				jQuery('#projectform .form-control').each(function(){
					var name = 'form.'+jQuery(this).attr('name');
					m.$set(name, jQuery(this).val());
				});
			},
		},
	});

	var vuebody = Vue.extend({
		components: {
			'project-modal-button': projectModalButton,
			'project-modal-head': projectModalHead,
		},
		template:"<project-modal-button></project-modal-button>"
				+'<project-modal-head></project-modal-head>',
	});

	m = new Vue({
		el: '#create-a-makeros-project',
		components: {
			'vuebody': vuebody,
		},
		data:{
			provider:'',
		},
		replace: false,
		template:'<link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.6/css/bootstrap.min.css" integrity="sha384-1q8mTJOASx8j1Au+a5WDVnPi2lkFfwwEAa8hDDdjZlpLegxhjVME1fgjWPGmkzs7" crossorigin="anonymous">'
				+'<link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.6/css/bootstrap-theme.min.css" integrity="sha384-fLW2N01lMqjakBkx3l/M9EahuwpSfeNvV63J5ezn3uZzapT0u7EYsXMjQV+0En5r" crossorigin="anonymous">'
				+'<link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/font-awesome/4.5.0/css/font-awesome.min.css">'
				+'<vuebody></vuebody>',
		methods:{
			canhas: function(){
				jQuery('#projectModal').modal('show');
			},

		},
		ready: function(){

		},
	});

};


